import React, { Component } from "react";
import Slider from "react-slick";
import { slideSlick } from "../page-demo/script";
import Particles from 'react-particles-js';


const SlideList = [
    {
        textPosition: 'text-left',
        bgImage: 'bg_image--1',
        title: 'Your path to phygital experiences',
        description: 'Our personalized solutions aim to close the gap between physical and digital experiences.',
        buttonText: 'Use Cases',
        buttonLink: '/Use-Case'
    },
    {
        textPosition: 'text-left',
        bgImage: 'bg_image--1',
        title: 'Advertising',
        description: 'Computer vision and blockchain solution to understand and trace people reactions.',
        buttonText: 'See More',
        buttonLink: '/Automation'
    },
    {
        textPosition: 'text-left',
        bgImage: 'bg_image--1',
        title: 'Dynamic content',
        description: 'Computer vision solutions to display dynamic content on screens.',
        buttonText: 'See More',
        buttonLink: '/AI-and-real-time-dynamic-content-on-advertising-screens'
    }
]

class BreadcrumpS extends Component{
    render(){

        return(
          <React.Fragment>
            <div className="slider-wrapper slider-creative-agency with-particles" id="home">
                  <div className="slider-activation">
                      <Slider className="rn-slick-dot dot-light" {...slideSlick}>
                          {SlideList.map((value , index) => (
                              <div className={`slide slide-style-2 slider-box-content without-overlay d-flex align-items-center justify-content-center bg_image ${value.bgImage}`} key={index}>
                                  <div className="frame-layout__particles">
                                      <Particles
                                          params={{
                                              "particles": {
                                                  "number": {
                                                      "value": 70
                                                  },
                                                  "size": {
                                                      "value": 2
                                                  }
                                              },
                                              "interactivity": {
                                                  "events": {
                                                      "onhover": {
                                                          "enable": true,
                                                          "mode": "repulse"
                                                      }
                                                  }
                                              }
                                          }}
                                      />
                                  </div>
                                  <div className="container">
                                      <div className="row">
                                          <div className="col-lg-12">
                                              <div className={`inner ${value.textPosition}`}>
                                                  {value.category ? <span>{value.category}</span> : ''}
                                                  {value.title ? <h2 style={{color:'white'}} className="title">{value.title}</h2> : ''}
                                                  {value.description ? <p className="description">{value.description}</p> : ''}
                                                  {value.buttonText ? <div className="slide-btn"><a className="rn-button-style--2 btn-solid" href={`${value.buttonLink}`}>{value.buttonText}</a></div> : ''}
                                              </div>
                                          </div>
                                      </div>
                                  </div>
                              </div>
                          ))}
                      </Slider>
                  </div>
              </div>
          </React.Fragment>
        )
    }
}


export default BreadcrumpS;
